import React, { useState } from 'react';
import { View, Text, TouchableOpacity, StyleSheet, Image, FlatList } from 'react-native';
import { useNavigate } from 'react-router-dom';
import arrow from "./AlwaysActive/images/arrow.png";
import { personList, exponateList } from '../Application/Classes/testDataGenerator';

const persons = personList;
const exponate = exponateList;

const Home = ({ darkMode }) => { // Dark Mode als Prop empfangen
    const [hoveredIndex, setHoveredIndex] = useState(null);
    const navigate = useNavigate();

    const handleNavigation = (route) => {
        navigate(route);
    };

    const handleHover = (index) => {
        setHoveredIndex(index);
    };

    const renderPerson = ({ item, index }) => (
        <View
            style={{ width: 400, flexDirection: "row" }}
            key={index}
            onMouseEnter={() => handleHover(index)}
            onMouseLeave={() => handleHover(null)}
        >
            <View style={stylesTexts.simpleListItem}>
                <View style={{ flexDirection: "row", width: 400 }}>
                    <Text style={[stylesTexts.listText, darkMode ? stylesTexts.darkText : stylesTexts.lightText]}>
                        {item.nachname}
                    </Text>
                    <Text> </Text>
                    <Text style={[stylesTexts.listText, darkMode ? stylesTexts.darkText : stylesTexts.lightText]}>
                        {item.vorname}
                    </Text>
                </View>
            </View>
        </View>
    );

    const renderExpon = ({ item, index }) => (
        <View
            style={{ width: 400, flexDirection: "row" }}
            key={index}
            onMouseEnter={() => handleHover(index)}
            onMouseLeave={() => handleHover(null)}
        >
            <View style={stylesTexts.simpleListItem}>
                <View style={{ flexDirection: "row", width: 1000 }}>
                    <Text style={[stylesTexts.listText, { width: 100 }, darkMode ? stylesTexts.darkText : stylesTexts.lightText]}>
                        {item.exponatId}
                    </Text>
                    <Text style={[stylesTexts.listText, { width: 180 }, darkMode ? stylesTexts.darkText : stylesTexts.lightText]}>
                        {item.titel}
                    </Text>
                    <Text style={[stylesTexts.listText, { width: 100 }, darkMode ? stylesTexts.darkText : stylesTexts.lightText]}>
                        {item.kategorie}
                    </Text>
                    <Text style={[stylesTexts.listText, { width: 100 }, darkMode ? stylesTexts.darkText : stylesTexts.lightText]}>
                        {item.masse}
                    </Text>
                    <Text style={[stylesTexts.listText, { width: 100 }, darkMode ? stylesTexts.darkText : stylesTexts.lightText]}>
                        {item.gewicht}
                    </Text>
                    <Text style={[stylesTexts.listText, { width: 300 }, darkMode ? stylesTexts.darkText : stylesTexts.lightText]}>
                        {item.kommentar}
                    </Text>
                </View>
            </View>
        </View>
    );

    return (
        <View style={[stylesContainers.container, darkMode ? stylesContainers.darkBg : stylesContainers.lightBg]}>
            <View style={stylesContainers.welcomeView}>
                <Text style={[stylesTexts.welcomeText, darkMode ? stylesTexts.darkWelcomeText : stylesTexts.lightWelcomeText]}>
                    Willkommen!
                </Text>
            </View>
            <View style={stylesContainers.diffcont}>
                <View style={[stylesContainers.viewListExponate, darkMode ? stylesContainers.darkListContainer : stylesContainers.lightListContainer]}>
                    <View>
                        <View style={{ flexDirection: "row", marginLeft: 20, marginRight: 20, marginTop: 20 }}>
                            <Text style={[stylesTexts.titleOfLists, darkMode ? stylesTexts.darkTitle : stylesTexts.lightTitle]}>
                                Exponate
                            </Text>
                            <View style={{ paddingLeft: 850 }}>
                                <TouchableOpacity onPress={() => handleNavigation("/exponate")}>
                                    <Image style={stylesTexts.images} source={arrow} />
                                </TouchableOpacity>
                            </View>
                        </View>
                    </View>
                    <View style={{ marginLeft: 20, marginRight: 20, marginTop: 3 }}>
                        <View style={{ flexDirection: "row" }}>
                            <Text style={[stylesTexts.listValueName, { width: 100 }]}>ID</Text>
                            <Text style={[stylesTexts.listValueName, { width: 180 }]}>Titel</Text>
                            <Text style={[stylesTexts.listValueName, { width: 100 }]}>Kategorie</Text>
                            <Text style={[stylesTexts.listValueName, { width: 100 }]}>Masse</Text>
                            <Text style={[stylesTexts.listValueName, { width: 100 }]}>Gewicht</Text>
                            <Text style={[stylesTexts.listValueName, { width: 100 }]}>Kommentar</Text>
                        </View>
                        <View style={{ height: 230, marginTop: 3 }}>
                            <FlatList
                                data={exponate}
                                renderItem={renderExpon}
                                keyExtractor={(item, index) => index.toString()}
                                initialNumToRender={10}
                                maxToRenderPerBatch={10}
                                windowSize={5}
                            />
                        </View>
                    </View>
                </View>
            </View>
        </View>
    );
};

const stylesContainers = StyleSheet.create({
    container: {
        flexDirection: "column",
        justifyContent: 'center',
        alignItems: 'center',
        width: 1350,
        paddingLeft: 20
    },
    lightBg: {
        backgroundColor: '#fff',
    },
    darkBg: {
        backgroundColor: 'rgb(18, 18, 18)',
    },
    diffcont: {
        flexDirection: "row",
        padding: 20
    },
    viewListExponate: {
        borderWidth: 1,
        borderRadius: 5,
        paddingLeft: 10,
        paddingRight: 10,
        height: 300,
        width: 1000,
        margin: 10
    },
    lightListContainer: {
        borderColor: 'lightgray',
        backgroundColor: '#fff',
    },
    darkListContainer: {
        borderColor: 'rgb(34, 34, 34)',
        backgroundColor: 'rgb(34, 34, 34)',
    },
    welcomeView: {
        paddingTop: 40,
        paddingBottom: 20,
    },
});

const stylesTexts = StyleSheet.create({
    welcomeText: {
        fontWeight: "bold",
        fontSize: 50,
    },
    lightWelcomeText: {
        color: 'rgba(240,175,77,1)',
    },
    darkWelcomeText: {
        color: 'rgb(85, 129, 176)',
    },
    titleOfLists: {
        fontWeight: "bold",
        fontSize: 17
    },
    lightTitle: {
        color: 'rgba(141,69,85,1)',
    },
    darkTitle: {
        color: 'rgb(85, 129, 176)',
    },
    listText: {
        fontWeight: "bold",
        fontSize: 12,
    },
    lightText: {
        color: "rgba(33,33,33,1)",
    },
    darkText: {
        color: "white",
    },
    listValueName: {
        fontWeight: "bold",
        fontSize: 14
    },
    images: {
        width: 20,
        height: 20,
    },
    simpleListItem: {
        flexDirection: "row",
        fontSize: 16,
        paddingVertical: 5,
        borderBottomWidth: 1,
    },
});

export default Home;
